import React,{ FC } from 'react';
import { LikeIcon } from '../../assets/icons/icons';
import './live-stream.scss';

export const LiveStream:FC  = () => {
    return(
        <div className="live">
            <div className="live__video">
                {/* <h1>LiveStream</h1> */}
                <div className="live__video--frame">
                    <img src="" alt="" className="img" />
                </div>
                <div className="live__video--reaction">
                    <div className="icon">
                        <LikeIcon/>
                    </div>
                    <div className="icon">share</div>
                    <div className="icon">comment</div>
                </div>
            </div>
        </div>
    )
}
